criteria:
Inclusion Criteria:

  -  stable COPD with mild-to-moderate airflow obstruction as indicated by the low ratio
     between forced expiratory volume in one second and forced vital capacity
     (FEV1/FVC<0.7) together with post-bronchodilator FEV1≥60% predicted under optimized
     clinical treatment as judged by the accompanying physician

Exclusion Criteria:

  -  unable to perform all experimental procedures and/or provide informed consent;

  -  hospital admission in the previous 6 weeks;

  -  exercise training program in the previous 6 months;

  -  any condition that could interfere with the ability to exercise;

  -  diagnosed psychiatric or cognitive disorders;

  -  type I insulin-dependent diabetes mellitus;

  -  excessively over-weight (BMI>35kg/m²);

  -  other diagnosed cardiorespiratory disorders (e.g., chronic heart failure, peripheral
     artery disease).

Inclusion Criteria:

  -  HIV-1 infection;

  -  Patient included in the Swiss HIV Cohort Study (SHCS);

  -  ≥ 18 years of age;

  -  Virologically suppressed for at least 24 months on first line triple ART (changes for
     toxicity permitted) with at least 4 HIV-1 RNA measurements in plasma <50 copies/ml;

  -  No history of previous failure on ART;

  -  No documented antiretroviral drugs resistance;

  -  No co-infection with Hepatitis B or C virus;

  -  Effective contraception in women;

  -  Willing to provide CSF and semen samples;

  -  Written informed consent

Exclusion Criteria:

  -  HIV-2 infection;

  -  Renal dysfunction (creatinine clearance <50ml/min);

  -  aspartate transaminase or alanine aminotransferase >5x upper limit normal;

  -  Concomitant use of carbamazepine, oxcarbazepine, phenytoin, phenobarbital, St John's
     wort, rifampicin or metformin;

  -  Previous AIDS defining conditions or active malignancy in the past five years;

  -  Positive HIV viral load in CSF at baseline;

  -  Known or suspected non-compliance;

  -  Women who are pregnant or breastfeeding.
